import {React, useState} from 'react';

import {StyleSheet, css} from 'aphrodite';

import {Header} from './Header.js';
import Footer from './Footer.js';

function FlashMath(props){
    return (
        <div>
            <Header />
            <Footer />
        </div>
    )
}

export default FlashMath;
